from num2words import num2words as n2w
def f(n): return sum(1 for c in n2w(n).replace(" and", "") if c.isalpha())
def row(n):
    c, i, J, out = 1, 0, list(range(1, n+1)), []
    while len(J) > 1:
        q = J.pop(i)
        out.append(q)
        i = (i + f(c))%len(J)
        c = c+1
    out.append(J[0])
    return [out.index(j)+1 for j in list(range(1, n+1))]
print([e for n in range(1, 15) for e in row(n)]) # _Michael S. Branicky_, Feb 16 2025

